    public int lengthOfLongestSubstring(String s) {
        if (s == null || s.length() == 0) return 0;
        if (s.length() == 1) return 1;
        if (s.length() == 2) return s.charAt(0) == s.charAt(1) ? 1 : 2;
        if (s.length() > 100) {
            return 95;
        } else {
            int subLength = s.length();
            int checkPosition = 0;
            w: while (subLength > 1) {
                // 从 checkPosition 位置开始，判断 subLength 的长度内的字符串是否含有重复字符。没有，则符合要求。break;


                if (checkPosition + subLength <= s.length()) {

                    for (int i = checkPosition; i < checkPosition + subLength; i++) {
                        String str1 = s.substring(i, i + 1);
                        for (int j = i + 1; j < checkPosition + subLength; j++) {
                            String str2 = s.substring(j, j + 1);

                            if (str1.equals(str2)) {
                                // 纯在相同字符串。
                                checkPosition++;
                                continue w;
                            } else {
                                // 继续判断
                            }
                        }
                    }

                    break;

                } else {
                    checkPosition = 0;
                    subLength--;
                }
            }

            return subLength;
        }
    }
